import styled from "styled-components";
import { NavLink, Link } from "react-router-dom";

//////////////////////////////////////
/*1 Nav*/
//////////////////////////////////////

const BtnContainer = styled.div`
  flex: 1;
  padding-right: 47px;
  display: flex;
  justify-content: flex-end;
`;
const BtnP = styled.div`
  padding-right: 7px;
`;
const NavBtn = styled(NavLink)`
  font-size: 1rem;
  font-family: NanumSquareB;
  cursor: pointer;
  width: 80px;
  height: 33px;

  text-decoration: none;

  display: flex;
  justify-content: center;
  align-items: center;

  border: 1px solid var(--white-two);
  border-radius: 16.5px;
  outline: none;

  color: var(--brownish-grey);

  font-size: 13.5px;

  &:hover {
    border: 1px solid var(--greenish-teal);
    color: var(--greenish-teal);
  }
`;

//////////////////////////////////////
/*2 Nav */
//////////////////////////////////////
const HomeNav = styled.div`
  padding-top: 17px;
  padding-left: 171px;
  display: flex;
  align-items: center;
  height: 6.64%;
`;

const NavItem = styled.div`
  font-size: 13.5px;
  color: var(--brownish-grey);
  font-family: NanumSquareB;
  margin-right: 49px;

  &:hover {
    color: var(--greenish-teal);
  }
`;

const NavClickItem = styled.div`
  font-size: 13.5px;
  color: var(--greenish-teal);
  font-family: NanumSquareB;
  margin-right: 49px;
`;
const AuthBox = styled.div`
  margin-left: 57px;
  display: flex;
`;

export { BtnContainer, BtnP, NavBtn, HomeNav, NavItem, NavClickItem, AuthBox };
